import React from 'react';
import HomePage from './pages/homepage-component';
import {Route} from 'react-router-dom';
import './App.css';

const HatsPage = () =>(
  <div>
    <h1>Hats Page</h1>
  </div>
);
function App() {
  return (
    <div >
      <switch>
        <Route exact path='/' component={HomePage}/>
        <Route  path='/hats' component={HatsPage}/>

      </switch>
    <HomePage></HomePage>
    </div>
  );
}

export default App;
